INSERT INTO `article_translations` VALUES (7,4,'fr','MON BÉBÉ EST NÉ !','Lorsqu’un projet prend 9 mois à naître, on peut presque le considérer comme un bébé non ? D’autant plus que c’est mon premier grand projet d’affaires depuis ma sortie de l’École d’Entrepreneurship de Beauce et que mes yeux s’illuminent dès que je pose mes yeux sur lui. ','MON BÉBÉ EST NÉ !','Lorsqu’un projet prend 9 mois à naître, on peut presque le considérer comme un bébé non ? D’autant plus que c’est mon premier grand projet d’affaires...','mon-bebe-est-ne','/storage/articles/c/b/d/cbdc33e9df20ef5847dfd47eab74a90d7eaf7a4e.png','[{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"MON B\\u00c9B\\u00c9 EST N\\u00c9 !\\n\\nLorsqu\\u2019un projet prend 9 mois \\u00e0 na\\u00eetre, on peut presque le consid\\u00e9rer comme un b\\u00e9b\\u00e9 non ? D\\u2019autant plus que c\\u2019est mon premier grand projet d\\u2019affaires depuis ma sortie de l\\u2019\\u00c9cole d\\u2019Entrepreneurship de Beauce et que mes yeux s\\u2019illuminent d\\u00e8s que je pose mes yeux sur lui. \\n\\nBien s\\u00fbr, il y a [Pink Poka](https:\\/\\/pinkpoka.com\\/), ma boutique en ligne d\\u2019accessoire haut de gamme, mais mon tout nouveau b\\u00e9b\\u00e9, Runway2Doorway, a un petit je-ne-sais-quoi \\u00bb qui me rend bien fi\\u00e8re ! \\n\\nJ\\u2019esp\\u00e8re que vous serez aussi \\u00e9merveill\\u00e9s que moi de notre site et du service exclusif que nous offrons.\\n\\nMais surtout, j\\u2019esp\\u00e8re que notre service gratuit de stylisme et de magasinage personnalis\\u00e9 saura vous aider dans la gestion de votre temps. Car le but de Runway2Doorway est de vous simplifier la vie et de la rendre encore plus belle.\\nJe vous invite d\\u00e8s maintenant \\u00e0 [remplir votre profil](http:\\/\\/runway2doorway.imarcom.ca\\/register). Un petit cinq minutes qui vous en fera sauver des centaines par la suite. \\n\\nMa belle gang de stylistes n\\u2019attend que vous !\\n\\nAu plaisir,\\n\\nMarie-Chrystelle Cheikha\\nStyliste fondatrice R2D\\n\",\"image\":\"\\/storage\\/articles\\/c\\/b\\/d\\/cbdc33e9df20ef5847dfd47eab74a90d7eaf7a4e.png\"}}]'),(8,4,'en','MY BABY IS BORN !','When it takes 9 month of dedicated preparation for a project to be brought to life, we can definetely compare it to a baby, can’t we?  It is also my first big business project since i graduated from Entrepreuneurship Bauce’s School. I will not lie, I have litterally sparks in my eyes every time I talk about it. ','MY BABY IS BORN !','When it takes 9 month of dedicated preparation for a project to be brought to life, we can definetely compare it to a baby, can’t we?  It is also my f...','my-baby-is-born','/storage/articles/c/b/d/cbdc33e9df20ef5847dfd47eab74a90d7eaf7a4e.png','[{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"My baby is born! \\n\\nWhen it takes 9 month of dedicated preparation for a project to be brought to life, we can definetely compare it to a baby, can\\u2019t we?  It is also my first big business project since i graduated from Entrepreuneurship Beauce\\u2019s School. I will not lie, I have litterally sparks in my eyes every time I talk about it. \\n\\nOf course I own Pink Poka, a high-end accessories online store, but Runway2Doorway is the main project that makes me so proud. \\n\\nI sincerely hope that you will that you will be as amazed as I am about this exclusive personal styling service. \\n\\nAbove all, I truly believe that you will save a massive amount of time and headeaches using our service. Runway2Doorway will also let you live your life to the fullest, knowing that you are wearing high-end clothes and accessories that are the top in fashion trends. \\n\\nI invite you to [get started today](http:\\/\\/runway2doorway.imarcom.ca\\/register). It will take you a 5 minutes that will make you save a lot more. \\n\\nMy awesome team of personal stylists is waiting for you! \\n\\nBest regards, \\n\\nMarie-Chrystelle Cheikha\\nPersonal stylist and founder of R2D\\n\",\"image\":\"\\/storage\\/articles\\/c\\/b\\/d\\/cbdc33e9df20ef5847dfd47eab74a90d7eaf7a4e.png\"}}]'),(71,36,'fr','LA COULEUR DE L’ANNÉE','','LA COULEUR DE L’ANNÉE','','la-couleur-de-lannee','/storage/articles/f/b/b/fbb63cd40e3c2435c38e989ca0ac9a499a30380e.jpeg','[{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"Et la gagnante 2017 est\\u2026 Greenery 15-0343 !\\n\\nCette couleur ne vous dit rien ? Normal puisque c\\u2019est son nom \\u00ab Pantone \\u00bb, un syst\\u00e8me international de classification chiffr\\u00e9 de couleurs qui n\\u2019en contient pas moins de 3000! On est loin des trois couleurs primaires\\u2026\\nEn terme plus clair et plus po\\u00e9tique, cette couleur est une \\u00ab nuance fra\\u00eeche, pleine de zestes, entre le jaune et le vert, qui \\u00e9voque les premiers jours du printemps quand la nature verdoie, revit, se restaure, se r\\u00e9g\\u00e9n\\u00e8re \\u00bb. \\nPourquoi vous parler de cette couleur ? Car chaque ann\\u00e9e, c\\u2019est la gagnante qui dicte les tendances dans le domaine de la mode. En tant que designer de pr\\u00e9sentation au service d\\u2019entreprises \\u0153uvrant dans le secteur de la mode, je peux vous confirmer que c\\u2019est cette couleur qui dominera les vitrines des boutiques ce printemps.\\nQui dit vert dit v\\u00e9g\\u00e9taux, donc in\\u00e9vitablement on pense aux fleurs. Je dois dire que, de mani\\u00e8re g\\u00e9n\\u00e9rale, je remarque un retour en force des motifs floraux et v\\u00e9g\\u00e9taux. Un v\\u00e9ritable retour vers la nature o\\u00f9 la faune et la flore deviennent de v\\u00e9ritables embl\\u00e8mes de style et donnent le ton aux tendances vestimentaires printemps-\\u00e9t\\u00e9 2017. Rafraichissent \\u00e0 lire apr\\u00e8s toute cette neige re\\u00e7ue cette semaine, n\\u2019est-ce pas ?\\nJe vous l\\u2019accorde, ces motifs ne sont pas une nouveaut\\u00e9 en soi, mais \\u00e0 mon avis, c\\u2019est la mani\\u00e8re cr\\u00e9ative dont le floral est int\\u00e9gr\\u00e9 aux v\\u00eatements qui fait toute la diff\\u00e9rence cette saison. Animaux exotiques et insectes sont \\u00e9lev\\u00e9s au rang d\\u2019ic\\u00f4nes en s\\u2019int\\u00e9grant aux motifs v\\u00e9g\\u00e9taux et floraux sous formes multiples ; broderies, imprim\\u00e9s superpos\\u00e9s ou encore, orn\\u00e9s de paillettes et de pierres d\\u00e9coratives. \\nCe qui m\\u2019am\\u00e8ne \\u00e0 vous parler du retour marqu\\u00e9 des broderies \\u00ab patchs \\u00bb autocollantes, cette tendance typiquement 60\\u2019s o\\u00f9 on int\\u00e8gre al\\u00e9atoirement diff\\u00e9rents \\u00e9l\\u00e9ments brod\\u00e9s sur un jeans un blouson ou m\\u00eame un sac, pour le personnaliser. Cette saison, vous retrouverez des jeans et autres pi\\u00e8ces de v\\u00eatements contenant tout un \\u00e9cosyst\\u00e8me de \\u00ab patchs \\u00bb : fleurs, papillons, serpents, tigres et colibris pour ne nommer que ceux-l\\u00e0. Ne vous en faites pas, rien \\u00e0 voir avec les v\\u00eatements des garde-robes de vos \\u00ab matantes \\u00bb ! \\nN\\u2019ayez pas peur de m\\u00e9langer, cette saison, l\\u2019audace est de mise ! Vivement le printemps !\\n\\n\\nBlogueur: Louis-Michel Mass\\u00e9 \\nhttp:\\/\\/instagram.com\\/visuelbym\\nCr\\u00e9dit photo : Marc Cain\",\"image\":\"\\/storage\\/articles\\/f\\/b\\/b\\/fbb63cd40e3c2435c38e989ca0ac9a499a30380e.jpeg\"}},{\"templateId\":\"blockImage\",\"data\":{\"image0\":\"\\/storage\\/articles\\/7\\/7\\/d\\/77d9bfcd8c9ea218471015fe74288d2b70a8f497.jpeg\",\"image1\":\"\\/storage\\/articles\\/b\\/0\\/8\\/b08d140730ec250ed12f426c58ff5966c0aaf799.jpeg\"}}]'),(72,36,'en','THE COLOR OF THE YEAR','','THE COLOR OF THE YEAR','','the-color-of-the-year','/storage/articles/f/b/b/fbb63cd40e3c2435c38e989ca0ac9a499a30380e.jpeg','[{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"Et la gagnante 2017 est\\u2026 Greenery 15-0343 !\\n\\nCette couleur ne vous dit rien ? Normal puisque c\\u2019est son nom \\u00ab Pantone \\u00bb, un syst\\u00e8me international de classification chiffr\\u00e9 de couleurs qui n\\u2019en contient pas moins de 3000! On est loin des trois couleurs primaires\\u2026\\nEn terme plus clair et plus po\\u00e9tique, cette couleur est une \\u00ab nuance fra\\u00eeche, pleine de zestes, entre le jaune et le vert, qui \\u00e9voque les premiers jours du printemps quand la nature verdoie, revit, se restaure, se r\\u00e9g\\u00e9n\\u00e8re \\u00bb. \\nPourquoi vous parler de cette couleur ? Car chaque ann\\u00e9e, c\\u2019est la gagnante qui dicte les tendances dans le domaine de la mode. En tant que designer de pr\\u00e9sentation au service d\\u2019entreprises \\u0153uvrant dans le secteur de la mode, je peux vous confirmer que c\\u2019est cette couleur qui dominera les vitrines des boutiques ce printemps.\\nQui dit vert dit v\\u00e9g\\u00e9taux, donc in\\u00e9vitablement on pense aux fleurs. Je dois dire que, de mani\\u00e8re g\\u00e9n\\u00e9rale, je remarque un retour en force des motifs floraux et v\\u00e9g\\u00e9taux. Un v\\u00e9ritable retour vers la nature o\\u00f9 la faune et la flore deviennent de v\\u00e9ritables embl\\u00e8mes de style et donnent le ton aux tendances vestimentaires printemps-\\u00e9t\\u00e9 2017. Rafraichissent \\u00e0 lire apr\\u00e8s toute cette neige re\\u00e7ue cette semaine, n\\u2019est-ce pas ?\\nJe vous l\\u2019accorde, ces motifs ne sont pas une nouveaut\\u00e9 en soi, mais \\u00e0 mon avis, c\\u2019est la mani\\u00e8re cr\\u00e9ative dont le floral est int\\u00e9gr\\u00e9 aux v\\u00eatements qui fait toute la diff\\u00e9rence cette saison. Animaux exotiques et insectes sont \\u00e9lev\\u00e9s au rang d\\u2019ic\\u00f4nes en s\\u2019int\\u00e9grant aux motifs v\\u00e9g\\u00e9taux et floraux sous formes multiples ; broderies, imprim\\u00e9s superpos\\u00e9s ou encore, orn\\u00e9s de paillettes et de pierres d\\u00e9coratives. \\nCe qui m\\u2019am\\u00e8ne \\u00e0 vous parler du retour marqu\\u00e9 des broderies \\u00ab patchs \\u00bb autocollantes, cette tendance typiquement 60\\u2019s o\\u00f9 on int\\u00e8gre al\\u00e9atoirement diff\\u00e9rents \\u00e9l\\u00e9ments brod\\u00e9s sur un jeans un blouson ou m\\u00eame un sac, pour le personnaliser. Cette saison, vous retrouverez des jeans et autres pi\\u00e8ces de v\\u00eatements contenant tout un \\u00e9cosyst\\u00e8me de \\u00ab patchs \\u00bb : fleurs, papillons, serpents, tigres et colibris pour ne nommer que ceux-l\\u00e0. Ne vous en faites pas, rien \\u00e0 voir avec les v\\u00eatements des garde-robes de vos \\u00ab matantes \\u00bb ! \\nN\\u2019ayez pas peur de m\\u00e9langer, cette saison, l\\u2019audace est de mise ! Vivement le printemps !\\n\\n\\nBlogueur: Louis-Michel Mass\\u00e9 \\nhttp:\\/\\/instagram.com\\/visuelbym\\nCr\\u00e9dit photo : Marc Cain\",\"image\":\"\\/storage\\/articles\\/f\\/b\\/b\\/fbb63cd40e3c2435c38e989ca0ac9a499a30380e.jpeg\"}},{\"templateId\":\"blockImage\",\"data\":{\"image0\":\"\\/storage\\/articles\\/7\\/7\\/d\\/77d9bfcd8c9ea218471015fe74288d2b70a8f497.jpeg\",\"image1\":\"\\/storage\\/articles\\/b\\/0\\/8\\/b08d140730ec250ed12f426c58ff5966c0aaf799.jpeg\"}}]'),(79,40,'fr','CONCOURS MÉTAMORPHOSE BEAUTÉ','','CONCOURS MÉTAMORPHOSE BEAUTÉ','','concours-metamorphose-beaute','/storage/articles/8/3/f/83f74623e1aec837f5dd8960456fc5603e84c858.jpeg','[{\"templateId\":\"blockImageText\",\"data\":{\"text\":\"Passez une journ\\u00e9e en compagnie de la styliste Marie-Chrystelle Cheikha et faites-vous bichonner par nos experts beaut\\u00e9.\\n\\nLa journ\\u00e9e comprend :\\n-\\tUn rendez-vous au salon de coiffure Maison Maxime (coupe\\/brushing) ainsi qu\'un ensemble de produits capillaires de la boutique Zazz\\n-\\tUn soin de beaut\\u00e9, un maquillage, ainsi qu\'une trousse de produits personnalis\\u00e9s en cadeau de chez Espace Beaut\\u00e9 Marie-Gagnon\\n-\\tUn look complet \\u00e0 l\\u2019Entrep\\u00f4t Cheikha gr\\u00e2ce au service de stylisme personnalis\\u00e9 Runway 2 Doorway r\\u00e9alis\\u00e9 par Marie-Chrystelle Cheikha\\n-\\tUn ensemble de bijoux Pink Poka \\n-\\tEt une s\\u00e9ance photo dans notre studio\\n\\nPour participer :\\n1.\\t\\u00catre \\u00e2g\\u00e9e de 18 ans et plus ainsi qu\' habiter la ville de Qu\\u00e9bec et les environs.\\n2.\\tFaites nous parvenir une vid\\u00e9o expliquant la raison pour laquelle vous seriez la candidate parfaite ou peut-\\u00eatre nous pr\\u00e9senter quelqu\'un dans votre entourage qui  m\\u00e9riterait de profiter de cette m\\u00e9tamorphose. Soyez cr\\u00e9ative et amusez-vous! \\n3.\\tEnvoyer votre inscription \\u00e0 [info@runway2doorway.com](mailto:info@runway2doorway.com)\\n4.\\tAimer notre page Facebook [Runway 2 Doorway](http:\\/\\/www.facebook.com\\/runway2doorway\\/), ainsi que nos partenaires [Cheikha Entrep\\u00f4t](http:\\/\\/www.facebook.com\\/cheikhaentrepot\\/), [Pink Poka](http:\\/\\/www.facebook.com\\/PinkPoka\\/), [Espace Beaut\\u00e9 Marie-Gagnon](http:\\/\\/www.facebook.com\\/espacebeaute.co\\/), [Maison Maxime](http:\\/\\/www.facebook.com\\/Maison-Maxime-251421951575208\\/) et [Zazz](http:\\/\\/www.facebook.com\\/boutiquezazz\\/).\\n5.\\tBonne chance \\u00e0 toutes! \\n\\n**Veuillez noter qu\'une capsule vid\\u00e9o de votre m\\u00e9tamorphose sera diffus\\u00e9e sur nos r\\u00e9seaux sociaux ainsi que sur ceux de nos partenaires.**\\n\\nLe concours prendra fin le 15 octobre prochain et nous r\\u00e9v\\u00e9lerons le nom de la gagnante sur notre page Facebook. \\n\\n\\n\",\"image\":\"\\/storage\\/articles\\/8\\/3\\/f\\/83f74623e1aec837f5dd8960456fc5603e84c858.jpeg\"}}]'),(80,40,'en','BEAUTY MAKEOVER CONTEST','','BEAUTY MAKEOVER CONTEST','','beauty-makeover-contest','/storage/articles/f/0/e/f0e7f8a678a075f0e2f41dd03924016708db1810.jpeg','[{\"templateId\":\"blockImageText\",\"data\":{\"text\":\"njbasjxbs\",\"image\":\"\\/storage\\/articles\\/7\\/f\\/b\\/7fb0e204488ff6fa0112644ddce44fea0191b022.jpeg\"}}]'),(81,41,'fr','LAISSEZ NOUS LE PLAISIR DE VOUS PRÉSENTER NOS MARQUES','Vous ne connaissez certainement pas toutes nos lignes de vêtements alors laissez nous le plaisir de vous les présenter. Voici nos trois lignes de vêtements vedettes. Luisa Cerano, Riani et Marc Cain.','LAISSEZ NOUS LE PLAISIR DE VOUS PRÉSENTER NOS MARQUES','Vous ne connaissez certainement pas toutes nos lignes de vêtements alors laissez nous le plaisir de vous les présenter. Voici nos trois lignes de vête...','laissez-nous-le-plaisir-de-vous-presenter-nos-marques','/storage/articles/0/6/7/067f674a18ebd802d9639e3f7f82482e50126a32.jpeg','[{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"Luisa Cerano charme les femmes du monde entier gr\\u00e2ce \\u00e0 son individualit\\u00e9 remarquable. D\'une f\\u00e9minit\\u00e9 incomparable, cette ligne offre \\u00e0 la femme active, un look casual-chic, confortable et sans effort. Chaque saison, Luisa Cerano propose les plus r\\u00e9centes tendances avec un design impeccable, une confection de grande qualit\\u00e9 et un choix de mati\\u00e8res raffin\\u00e9. \",\"image\":\"\\/storage\\/articles\\/5\\/2\\/b\\/52b63dfc23e7a6ea203faaac486299f574b95b05.jpeg\"}},{\"templateId\":\"blockImageText\",\"data\":{\"text\":\"Marc Cain combine le sens de l\\u2019esth\\u00e9tique et de l\\u2019art avec une attitude d\\u00e9contract\\u00e9e et naturelle, la pens\\u00e9e innovatrice et l\\u2019exclusivit\\u00e9. Marc Cain est une d\\u00e9claration d\\u2019amour \\u00e0 la femme.\\n\\nMais \\u00e0 quel type de femme ? Elle vit aujourd\\u2019hui, elle est s\\u00fbre de soi, ouverte et curieuse. Elle adore \\u00eatre femme et s\\u2019exprime par ce qu\\u2019elle porte \\u2013 de mani\\u00e8re naturelle et \\u00e9vidente.\",\"image\":\"\\/storage\\/articles\\/b\\/f\\/3\\/bf31d56aa1edb3fe0f134065ee04dbe5cdab519e.jpeg\"}},{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"Collection de pr\\u00e9dilection pour la femme moderne, Riani est un parfait amalgame de confection allemande distincte, d\\u2019une qualit\\u00e9 irr\\u00e9prochable, dot\\u00e9e d\'une touche de modernisme. Mat\\u00e9riaux de premier choix, souvent produits en exclusivit\\u00e9. Elle doit sa r\\u00e9putation au succ\\u00e8s de ses coupes , de ses imprim\\u00e9s originaux et de ses styles sport-chics uniques adapt\\u00e9s \\u00e0 la femme d\\u2019aujourd\\u2019hui. La marque Riani sugg\\u00e8re des silhouettes ultra-f\\u00e9minines, une palette de couleurs riches, des tissus luxueux ainsi que des d\\u00e9tails uniques.  Riani s\\u2019\\u00e9l\\u00e8ve aux rangs des fournisseurs de renom tels que Prada, Etro et Lanvin.\",\"image\":\"\\/storage\\/articles\\/4\\/d\\/c\\/4dc2cf1f57db035bf0caa64142dc77474c350da1.jpeg\"}},{\"templateId\":\"blockImage\",\"data\":{\"image0\":\"\\/storage\\/articles\\/6\\/a\\/5\\/6a509ea9529cc5348d2052f99a3af24d803d1570.png\",\"image1\":\"\\/storage\\/articles\\/b\\/f\\/a\\/bfa4cd9c1c2b07fd37bb30d907c70a5598b77aa6.jpeg\"}},{\"templateId\":\"blockTextImage\",\"data\":{\"text\":\"Ces trois lignes sont les plus populaires au pr\\u00e8s de notre client\\u00e8le. Gr\\u00e2ce \\u00e0 Runway 2 Doorway elles sont plus accessibles et directement livr\\u00e9 \\u00e0 vous. Profitez d\'aubaines incroyables sur ces marques. La qualit\\u00e9, vous aussi vous y avez droit. \",\"image\":\"\\/storage\\/articles\\/2\\/4\\/0\\/24061529224729d2e58f557b1d4fe6416fb35b6f.png\"}}]'),(82,41,'en','LAISSEZ NOUS LE PLAISIR DE VOUS PRÉSENTER NOS MARQUES','Vous ne connaissez certainement pas toutes nos lignes de vêtements alors laissez nous le plaisir de vous les présenter. Voici nos trois lignes de vêtements vedettes. Luisa Cerano, Riani et Marc Cain.','LAISSEZ NOUS LE PLAISIR DE VOUS PRÉSENTER NOS MARQUES','Vous ne connaissez certainement pas toutes nos lignes de vêtements alors laissez nous le plaisir de vous les présenter. Voici nos trois lignes de vête...','laissez-nous-le-plaisir-de-vous-presenter-nos-marques','/storage/articles/0/6/7/067f674a18ebd802d9639e3f7f82482e50126a32.jpeg','[{\"templateId\":\"blockImageText\",\"data\":{\"text\":\"Luisa Cerano charme les femmes du monde entier gr\\u00e2ce \\u00e0 son individua