INSERT INTO `kit_requests` VALUES (1,7,'asDasda','-1000','','answered','2017-02-03 20:29:26','2017-03-21 17:48:11',NULL),(2,13,'robe pour mariage de mon amie - teinte crème','-200','','answered','2017-02-14 21:34:07','2017-09-12 17:51:04','2017-09-12 17:51:04'),(4,19,'Corporatif pour le travail ','-200','','answered','2017-02-14 22:39:58','2017-03-21 17:48:11',NULL),(5,34,'Pour mon voyage à Los Cabos','-500','Vêtements relax et classe. Je t\'envoie une photo d\'un collier pour te montrer un peu le style... D\'ailleurs, on pourrait peut-être ajouter l\'option ici dans le formulaire ??','answered','2017-02-15 15:32:28','2017-03-23 13:03:55','2017-03-23 13:03:55'),(11,35,'test','-200','test','answered','2017-02-15 19:01:08','2017-03-21 17:48:11',NULL),(14,53,'pour mon emploi','-2000','froid, aime tissu souple et doux et en vrai tissu comme cachemire...','pending','2017-03-21 17:06:47','2017-03-21 17:06:47','2017-03-21 17:06:47'),(15,35,'Blue Steel','+2000','je dois cacher mes épaules, je travaille dans un environnement très froid','answered','2017-02-20 13:56:10','2017-03-21 17:48:11',NULL),(16,60,'pour emploi','-500','Je travailles dans une banque, donc une tenue professionnelle mais en même temps j\'aime des vêtements original.','pending','2017-03-21 17:06:59','2017-03-21 17:06:59','2017-03-21 17:06:59'),(17,64,'fille qui veut !','-200','J\'aime la vie !','answered','2017-03-01 23:49:14','2017-03-23 13:04:16','2017-03-23 13:04:16'),(18,67,'Classic yet confortable outfit for the job, a day in Montreal ','-200','Shoulders must be covered, no skirt','answered','2017-03-03 17:15:53','2017-09-12 17:51:10','2017-09-12 17:51:10'),(19,69,'Look chic décontracté ','-1000','Je souhaite avoir un look chic décontracté, sport','answered','2017-03-05 15:54:00','2017-09-12 17:51:35','2017-09-12 17:51:35'),(20,71,'vêtements pour travailler et être confortable/chic','-200','','answered','2017-03-06 04:03:22','2017-03-23 13:04:27','2017-03-23 13:04:27'),(21,35,'asdhasdhashdasdhasdhasd','-200','test','pending','2017-03-21 17:07:09','2017-03-21 17:07:09','2017-03-21 17:07:09'),(22,85,'croisière','-200','cacher mes fesses et cuisses','answered','2017-03-14 12:09:58','2017-09-12 17:51:48','2017-09-12 17:51:48'),(23,91,'Printemps à l\'aréna','-200','Je veux des agencements douillets avec de la gueule pour porter avec des jeans ou jeggings. Je passe toutes mes fins de semaines dans les arénas. J\'aime être assez confortable mais surtout pas négligée.','answered','2017-03-14 14:42:12','2017-09-12 17:51:41','2017-09-12 17:51:41'),(24,114,'souper entre amie','-200','','answered','2017-03-14 16:40:26','2017-09-12 17:51:58','2017-09-12 17:51:58'),(25,149,'décontraté','-200','Pour le travail, pas trop chic, confortable et de bon gout','answered','2017-03-15 14:09:48','2017-09-12 17:52:07','2017-09-12 17:52:07'),(26,153,'allo','-200','','pending','2017-03-21 17:07:15','2017-03-21 17:07:15','2017-03-21 17:07:15'),(27,155,'fassss','-500','aFSDAsfasdf','pending','2017-03-21 17:07:23','2017-03-21 17:07:23','2017-03-21 17:07:23'),(28,156,'vêtements de travail pour tous les jours, confortables, mais avec un petit quelque chose d\'original','-500','J\'aime bien le look décontracté de Lucy Liu dans l\'émission Élémentaire.','answered','2017-03-15 16:30:00','2017-09-12 18:04:56','2017-09-12 18:04:56'),(29,153,'Allo','-200','Allo','pending','2017-03-21 17:07:30','2017-03-21 17:07:30','2017-03-21 17:07:30'),(30,158,'pour le travail, j\'aime les vestons mais avec quelques choses d\'éclater de style plus jeunes ','-200','dois être confortable et dois être original','answered','2017-03-15 17:43:24','2017-09-12 18:05:18','2017-09-12 18:05:18'),(31,159,'Présentation client','-200','J\'aime porter des jupes courtes, collant noirs et des coupes structurées en haut.','answered','2017-03-15 17:45:02','2017-09-12 18:05:10','2017-09-12 18:05:10'),(32,160,'TEST','-500','TEST','pending','2017-03-21 17:07:37','2017-03-21 17:07:37','2017-03-21 17:07:37'),(33,160,'test','-200','test','pending','2017-03-21 17:07:41','2017-03-21 17:07:41','2017-03-21 17:07:41'),(34,163,'Mon look PDG','-500','','answered','2017-03-15 20:34:02','2017-09-12 18:04:48','2017-09-12 18:04:48'),(35,162,'Tenue décontractée et de style pour l\'été...je passe les fins de semaines à notre maison de campagne....','-500','Je dois cacher mes genoux ..opération....Il est affreux.','answered','2017-03-15 20:43:42','2017-09-12 17:54:14','2017-09-12 17:54:14'),(36,50,'Pour le travail. Je suis à l\'université maintenant et c\'est sport chic.','-2000','','answered','2017-03-15 22:38:53','2017-09-12 18:05:40','2017-09-12 18:05:40'),(37,139,'Pour le travail (enseignante au secondaire) et pour les sorties avec mon chum au resto','-200','Pas de taille trop basse pour les pantalons. \r\nJe suis frileuse alors pas de vêtements de \"voile\" pour l\'instant. \r\n','answered','2017-03-16 00:09:02','2017-09-12 18:05:47','2017-09-12 18:05:47'),(38,142,'Tenue de tous les jours et tenue pour le travail.','-1000','Pas de veston ','answered','2017-03-16 00:27:02','2017-09-12 18:04:01','2017-09-12 18:04:01'),(39,94,'Vêtements à la fois élégants et confortables pour le travail ','-500','Je travaille dans un hôpital. Il y fait très chaud ','answered','2017-03-16 01:17:08','2017-09-12 18:04:31','2017-09-12 18:04:31'),(40,168,'tailors for my job','-200','I\"m young, i\'m working in the very straight business but I like my look to be classic with a funky touch.','answered','2017-03-16 01:20:16','2017-09-12 17:53:53','2017-09-12 17:53:53'),(41,170,'Robe pour une soirée chic thématique \'blanc\'','-200','Je serai dans un pays chaud. \r\nJe tiens à cacher mes genoux','answered','2017-03-16 02:31:37','2017-09-12 17:54:03','2017-09-12 17:54:03'),(42,108,'Robe dame d\'honneur','-200','J\'ai droit à toute les couleurs que je veux puisque je suis la seule demoiselle/dame d\'honneur, je suis prête à mettre 300$ incluant la robe et les chaussures, je ne veux pas d\'accessoire, je préfèrerais de couleur, rouge, marine, bourgogne ou rose perle, de préférence dos ouvert! Voilà! :) ','answered','2017-03-16 11:19:18','2017-09-12 18:05:54','2017-09-12 18:05:54'),(43,126,'robe cocktail mais pas trop chic','-200','Au-dessus des genoux; donc, pas trop courte.  Sans manche ou manches courtes.  Printemps-été.','answered','2017-03-16 13:34:52','2017-03-21 17:48:11',NULL),(44,171,'Souper resto','-200','Je suis toujours habillée de type bureau et un peu madame!\r\nJ\'aimerais quelque chose qui fait chic mais jeune, à la mode!\r\nCe n\'est pas une soirée officielle donc ça peut être décontracté, mais pas sport non plus.\r\nJe ne suis pas sûr d\'être de type pomme car j\'ai une taille, mais une forte poitrine et de fortes cuisses et hanches.\r\nJe ne tolère pas la laine, ses dérivés ainsi que l\'acrylique.\r\nMerci !','answered','2017-03-16 14:08:28','2017-09-12 18:08:02','2017-09-12 18:08:02'),(45,104,'pour mon travail','-500','je ne porte que des pantalons à mon travail. Chic mais pas trop.','answered','2017-03-16 14:42:49','2017-09-12 18:07:05','2017-09-12 18:07:05'),(46,172,'Décontracté de ville (travail et sortie)','-500','Un look élégant mais pas voyant (je n\'aime pas le «bling») qui convient aussi bien pour le travail que pour les sorties, dans des tons neutres avec un splash de couleur. J\'ai hâte de voir ce que vous me trouverez, je suis très pointilleuse sur la qualité de confection de mes vêtements, donc pas de rayonne...\r\n\r\nP.S. je vous enverrai une photo pleine longueur dans les prochains jours, le look que je demande n\'est donc pas urgent. Merci et bonne journée.','pending','2017-03-16 16:14:29','2017-03-21 17:48:11',NULL),(47,117,'vêtements pour le travail','-200','Comme j\'ai presqu\'atteint la soixantaine, je trouve difficile de choisir des vêtement qui font ni trop vieux, ni trop jeune. Je travaille dans le milieu muséal dans le secteur administratif.','answered','2017-03-16 19:51:58','2017-09-12 18:06:54','2017-09-12 18:06:54'),(48,176,'tenue décontracté chic','-200','','answered','2017-03-16 20:36:39','2017-03-22 21:27:55',NULL),(49,177,'pour mon emploi mais que je peux porter également le weekend','-500','Je ne dois pas être toujours en tailleur à mon travail.  Je dirais que pour moi l\'idéal pour moi serait sport chic ou \"casual chic\".  Un jeans le vendredi avec quelque chose de plus chic pour le haut fait très bien l\'affaire.','answered','2017-03-17 00:58:22','2017-09-12 18:08:18','2017-09-12 18:08:18'),(50,182,'Sortie avec un nouveau petit ami','-200','','answered','2017-03-17 18:20:28','2017-03-21 17:48:11',NULL),(51,154,'Pour le travail.  Corpo, élégant.','-1000','Je rencontre des clients importants.  Tenues simples et de qualité.','answered','2017-03-18 04:19:27','2017-03-22 15:49:29',NULL),(52,185,'Tenue de travail','-500','Je suis comptable agréé\r\nJ\'ai mon bureau\r\nLa tenue doit être chic mais pas trop pour ne pas avoir l\'air trop sévère ou difficile à aborder','answered','2017-03-18 11:02:31','2017-09-12 18:07:38','2017-09-12 18:07:38'),(53,189,'Souper entre amis','-500','','answered','2017-03-18 13:28:48','2017-03-22 16:24:08',NULL),(54,191,'Vêtements classiques pour travail de bureau ','-200','Épaules cachées\r\nVêtements pas trop chaud \r\nVêtements superposés. \r\n','answered','2017-03-18 13:35:26','2017-09-12 18:07:16','2017-09-12 18:07:16'),(55,196,'Tenue de bureau ','-200','','answered','2017-03-18 16:30:40','2017-09-12 18:07:28','2017-09-12 18:07:28'),(56,198,'Vêtements pour le travail ','-1000','','answered','2017-03-18 18:23:07','2017-03-22 15:59:25',NULL),(57,197,'Tenue de bureau ','-200','','answered','2017-03-18 20:46:15','2017-03-22 21:36:46',NULL),(58,199,'Travail bureau','-200','\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n','answered','2017-03-18 20:57:49','2017-03-22 21:42:21',NULL),(59,204,'Tenue classique pour sorties','-500','Camoufler ventre et borrelets taille','answered','2017-03-19 14:35:49','2017-03-22 16:32:48',NULL),(60,159,'presentation orale chez client','-200','Je voudrais un habit chic mais jeune','answered','2017-03-19 15:52:01','2017-04-06 00:49:36',NULL),(61,117,'Pour mon emploi','-200','Je travaille dans un musée.','answered','2017-03-20 18:40:44','2017-04-06 01:00:01',NULL),(62,138,'tenue élégante pour mon mariage et tenues pour le boulot','+2000','Pantalons : je porte parfois des 6, parfois des 8, dépendamment de leur coupe.\r\nJ\'ai les jambes très musclées : mollets très forts (mollets d\'hommes!), le tout dû à des années d\'entrainement en patin artistique et en trekking.\r\nJe suis faite \"large\", \"massive\" jambes longues pour un haut du corps \"court\" et peu gras (petite poitrine, pas de ventre). \r\nJ\'ai le teint pâle et les couleurs pâles ne me vont pas du tout.\r\nJe me marie le 29 décembre prochain et je cherche une robe qui me ressemblera : pas de blanc! quelque chose qui mettra en valeur mes bras musclés, mes épaules et mon ventre ferme... et qui adoucira mes jambes fortes.\r\nKristen Scott-Thomas est mon modèle d\'élégance. Simplicité, qualité des matériaux, côté \"voyageur confortable\"\r\nJ\'aime les tissus de belle qualité et les coupes simples à l\'italienne.\r\n','answered','2017-03-20 20:33:56','2017-04-05 02:22:11',NULL),(63,148,'Petit veston sport et pantalon pour voyage en Italie du 15 mai au 2 juin. J\'aimerais aussi une suggestion pour robe ou ensemble pour notre 50eme anniversaire de Mariage qui aura lieu le 16 septembre 2017.','-500','les robes qui ne sont pas coupées à la taille me conviennent mieux car j\'ai le corps assez long malgré mes 5pieds et 2pouces. J,ai hâte de voir vos suggestions...','answered','2017-03-20 22:40:26','2017-03-26 17:57:41',NULL),(64,178,'tenue week-end','-500','je travaille avec un costume, donc à mes journée de congé je veux un style, où je serais à l\'aise  et belle en même temps , j\'ai 2 jeunes qui demande beaucoup de temps , et moi j\'en ai peu mais j\'ai besoin de quelque chose de beau pour mon estime personnelle.....  merci à bientôt','answered','2017-03-23 13:16:55','2017-03-28 00:21:27',NULL),(65,217,'Business look','-2000','','answered','2017-03-27 21:41:56','2017-03-30 13:17:18',NULL),(66,220,'My daughter\'s communion','-500','Les couleurs de la journée serons beige et vieux rose...une robe cocktail qui peut être portée a l\'église.\r\n\r\nMerci Marie de jetter un coup d\'exil pour moi :-)\r\n\r\nNadia ','answered','2017-03-28 15:33:13','2017-04-03 20:49:12',NULL),(67,221,'Look 5@7','-1000','Je suis propriétaire d\'un centre de Yoga et photographe\r\nCependant, depuis 2 ans, je porte 90% du temps des Yoga Pants...et des vêtements de sports\r\nJ\'ai porté le tailleur et la robe noire ajusté durant près de 20 ans pour un travail de bureau\r\nDisons que j\'ai envie de me sentir féminine, désinvolte, sexy ','answered','2017-03-28 22:25:31','2017-03-31 12:42:37',NULL),(68,125,'Tenue pour le travail (jupe, robe, pantalon étroit, tailleur, etc.) J\'aime les tenues qui sont à la fois \'\'corporate\'\' mais avec un petit quelque chose de différent !','-200','Rien de spécial, mis à part que les tenues doivent être dans un cadre professionnel, donc pas de gros décolleté ou de jupes très courtes. \r\n\r\nEst-ce qu\'une photo vous aide davantage ? Si oui je pourrais essayer de vous transmettre le tout !\r\n\r\nmerci !','answered','2017-03-29 14:40:10','2017-04-06 00:34:01',NULL),(69,224,'printemps','-500','','pending','2017-03-30 02:38:54','2017-03-30 02:38:54',NULL),(70,178,'tenue passe partout pour le printemps','-200','','answered','2017-03-31 13:18:35','2017-04-05 23:48:33',NULL),(71,229,'Weekend','-200','Je travaille en uniformes.\r\nJ\'aime les looks weekend confortables et stylés qui permettent de passer du brunch à une promenade en ville.\r\nJ\'aime aussi ce qui est interchangeable, donc qui s\'agence aisément avec des pièces \"de base\" d\'une garde-robe.\r\nJ\'ai un faible pour les nouvelles tendances qui donnent un petit wow mais pas pour l\'excentricité!','answered','2017-04-05 03:37:56','2017-04-06 00:17:03',NULL),(72,178,'robe chemisier avec manches courtes ou longues','-200','en bas des genoux, dans un tissu fluide, dans le style marin si possible, moi, je la vois blanche et rouge  . merci d\'avoir créer ce service, c\'est vraiment utile. bonne journée ...\r\n','answered','2017-04-07 13:48:32','2017-04-09 17:37:02',NULL),(73,231,'T shirts feminins','-200','','answered','2017-04-16 09:34:32','2017-04-18 21:15:47',NULL),(74,232,'Robe de demoiselle d\'honneur','-200','Sans dentelle, longue de préférence. Je trouve que les bretelles spaghetti ne me font pas super bien mais je suis ouverte... La palette de couleur demandee par la mariee : vert menthe-gris, rose pâle, bourgogne-mauve. Je prefere le \'mint\'...','answered','2017-04-17 16:12:38','2017-04-18 21:10:14',NULL),(75,207,'Look d\'affaire','-500','Je bouge beaucoup à mon travail. J\'ai chaud facilement mais je DÉTESTE montrer mes bras. J\'aimerais un look classe; propre, mais à la fois séduisant. Je ne suis pas fan des cols roulés\r\n Je n\'aime pas me sentir prise au niveau de la gorge.\r\n\r\nPs. C\'est mon chum Guillaume  ( le grand que tu vois souvent au conti, qui m\'a parlé de ton service, je m\'occupe du salon, si jamais il t\'en avait parlé ;) )\r\n\r\nJe suis à l\'aise d\'aller te rencontrer au lieu de procéder pas commande en ligne. \r\n\r\nMerci\r\n ','pending','2017-04-20 16:19:15','2017-04-20 16:19:15',NULL),(76,236,'Everyday casual but trendy','-200','I like layers as I am always cold. Tank tops must have wide straps (2adult fingers wide minimum).','answered','2017-04-21 02:14:12','2017-04-27 18:37:12',NULL),(77,237,'oi','-200','ok','answered','2017-04-25 15:14:23','2017-05-02 23:12:34','2017-05-02 23:12:34'),(78,239,'General','-500','','answered','2017-04-28 22:41:32','2017-05-08 22:15:40',NULL),(79,240,'Tenues corporatives pour le bureau ','-200','Tenue pour l\'été, un peu plus colorée, plus légère. Merci! ','answered','2017-05-01 04:33:21','2017-09-12 17:14:07','2017-09-12 17:14:07'),(80,241,'Travail','-200','','answered','2017-05-02 21:54:13','2017-05-16 19:04:37',NULL),(81,243,'Ensemble de travail \"casual Friday\"','-200','Je travaille dans le domaine de la mode mais dans un environnement casual. J\'aime beaucoup me différencier avec un item vraiment mode dans ma tenue mais les autres articles restent \"classique\".','answered','2017-05-04 18:33:17','2017-05-16 19:56:16',NULL),(82,244,' élégante ','-200','','pending','2017-05-06 13:54:08','2017-05-06 13:54:08',NULL),(83,245,'Pour mon emploi','-200',' Je travaille comme conseillère publicitaire je dois donc ne pas être trop sexy ','answered','2017-05-06 18:18:41','2017-05-17 03:02:41',NULL),(84,250,'Robe pour invitée à un mariage en août chic, pas robe longue','-500','','answered','2017-05-10 17:43:58','2017-05-24 14:54:21',NULL),(85,158,'travail et tout allée','-200','Salut, tu m\'avais dit que tu me ferais de nouvelles suggestions quand tu aurais ta nouvelle boutique associée dont j\'oublie le nom.','pending','2017-05-13 20:01:20','2017-05-13 20:01:20',NULL),(86,254,'décontracté, tout allé','-200','dissimulé la petite bedaine donc pas de haut ajusté','pending','2017-05-15 19:26:21','2017-05-15 19:26:21',NULL),(87,256,'Tenue elegante et décontracté pour une soirée lors d\'un congrès à Nice','-200','J\'aimerais quelque chose qui n\'est pas trop court. Quelque chose qui fait estival. La soirée sera sur le bord de plage fin juin à Nice en France. ','answered','2017-05-17 23:56:03','2017-05-22 18:20:55',NULL),(88,45,'bomber','-200','','answered','2017-05-18 16:52:20','2017-05-22 16:28:58',NULL),(89,45,'t-shirt chemisier kaki','-200','','answered','2017-05-18 16:54:52','2017-05-24 14:48:18',NULL),(90,260,'mon anniversaire de mariage 50 personnes  sous un chapiteau au chalet','-1000','Je dois cacher mes biceps mous et mon ventre au-dessus de la taille','pending','2017-05-31 15:53:51','2017-05-31 15:53:51',NULL),(91,267,'Pour une sortie 5 à 7','-200','','answered','2017-08-23 19:36:09','2017-08-23 19:39:04',NULL),(92,268,'Look professionnel pour mon emploi ; je travaille dans le milieu financier.','-200','','pending','2017-08-29 02:29:36','2017-08-29 02:29:36',NULL),(93,268,'Look professionnel - Bureau ','-200','Je travaille dans le milieu financier et j\'aimerais avoir un beau \"kit\" jupe et tailleur.\r\n\r\nPour ma taille de pantalons, je suis normalement un 4, 5 ou 6 ; tout dépend de la marque. Pour les jupes, je suis plus une taille 4. J\'ai les épaules larges, car j\'ai fait beaucoup de natation plus jeune.\r\n\r\nJ\'ai ajouté la photo à mon profil. Merci de ne pas tenir compte de ma précédente requête ( sans photo).\r\n\r\nJessica ','pending','2017-08-29 13:31:07','2017-08-29 13:31:07',NULL),(94,175,'linge confo professionnel ','-500','Je suis directrice d\'une clinique privée pour services aux enfants.  Étant un peu ronde,je veux être confo et professionnelle.  ','answered','2017-08-31 00:26:09','2017-09-12 17:50:42','2017-09-12 17:50:42'),(95,269,'Golf','-200','Ensemble pour l\'été et pour l\'automne. Je porte pas de camisole car je n\'aime pas mes bras','answered','2017-09-04 16:00:04','2017-09-12 15:29:32','2017-09-12 15:29:32'),(96,276,'vetements de travail corporatifs','-500','','pending','2017-09-22 13:12:00','2017-09-22 13:12:00',NULL);
